import React from 'react';
import GoogleMapReact from 'google-map-react';

const Map = ({ apiKey }) => {
  const center = {
    lat: 37.7749,
    lng: -122.4194
  };
  const zoom = 10;
  return (
    <div style={{ height: '50vh', width: '100%' }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: apiKey }}
        defaultCenter={center}
        defaultZoom={zoom}
      >
      </GoogleMapReact>
    </div>
  );
};

export default Map;
